rite("\n"),document.write("\n"),document.write("// Draw colored overlay based on combined brightness of stars (light up the sky!)\n"),document.write("// Note: this is applied to the canvas container's background-color, so it's behind the particles\n"),document.write("const currentSkyColor = { r: 0, g: 0, b: 0 };\n"),document.write("const targetSkyColor = { r: 0, g: 0, b: 0 };\n"),document.write("function colorSky(speed) {\n"),document.write("// The maximum r, g, or b value that will be used (255 would represent no maximum)\n"),document.write("const maxSkySaturation = skyLightingSelector() * 15;\n"),document.write("// How many stars are required in total to reach maximum sky brightness\n"),document.write("const maxStarCount = 500;\n"),document.write("let totalStarCount = 0;\n"),document.write("// Initialize sky as black\n"),document.write("targetSkyColor.r = 0;\n"),document.write("targetSkyColor.g = 0;\n"),document.write("targetSkyColor.b = 0;\n"),document.write("// Add each known color to sky, multiplied by particle count of that color. This will put RGB values wildly out of bounds, but we'll scale them back later.\n"),document.write("// Also add up total star count.\n"),document.write("COLOR_CODES.forEach(color => {\n"),document.write("    const tuple = COLOR_TUPLES[color];\n"),document.write("    const count =  Star.active[color].length;\n"),document.write("    totalStarCount += count;\n"),document.write("    targetSkyColor.r += tuple.r * count;\n"),document.write("    targetSkyColor.g += tuple.g * count;\n"),document.write("    targetSkyColor.b += tuple.b * count;\n"),document.write("});\n"),document.write("\n"),document.write("// Clamp intensity at 1.0, and map to a custom non-linear curve. This allows few stars to perceivably light up the sky, while more stars continue to increase the brightness but at a lesser rate. This is more inline with humans' non-linear brightness perception.\n"),document.write("const intensity = Math.pow(Math.min(1, totalStarCount / maxStarCount), 0.3);\n"),document.write("// Figure out which color component has the highest value, so we can scale them without affecting the ratios.\n"),document.write("// Prevent 0 from being used, so we don't divide by zero in the next step.\n"),document.write("const maxColorComponent = Math.max(1, targetSkyColor.r, targetSkyColor.g, targetSkyColor.b);\n"),document.write("// Scale all color components to a max of `maxSkySaturation`, and apply intensity.\n"),document.write("targetSkyColor.r = targetSkyColor.r / maxColorComponent * maxSkySaturation * intensity;\n"),document.write("targetSkyColor.g = targetSkyColor.g / maxColorComponent * maxSkySaturation * intensity;\n"),document.write("targetSkyColor.b = targetSkyColor.b / maxColorComponent * maxSkySaturation * intensity;\n"),document.write("\n"),document.write("// Animate changes to color to smooth out transitions.\n"),document.write("const colorChange = 10;\n"),document.write("currentSkyColor.r += (targetSkyColor.r - currentSkyColor.r) / colorChange * speed;\n"),document.write("currentSkyColor.g += (targetSkyColor.g - currentSkyColor.g) / colorChange * speed;\n"),document.write("currentSkyColor.b += (targetSkyColor.b - currentSkyColor.b) / colorChange * speed;\n"),document.write("\n"),document.write("appNodes.canvasContainer.style.backgroundColor = `rgb(${currentSkyColor.r | 0}, ${currentSkyColor.g | 0}, ${currentSkyColor.b | 0})`;\n"),document.write("}\n"),document.write("\n"),document.write("mainStage.addEventListener('ticker', update);\n"),document.write("\n"),document.write("\n"),document.write("// Helper used to semi-randomly spread particles over an arc\n"),document.write("// Values are flexible - `start` and `arcLength` can be negative, and `randomness` is simply a multiplier for random addition.\n"),document.write("function createParticleArc(start, arcLength, count, randomness, particleFactory) {\n"),document.write("const angleDelta = arcLength / count;\n"),document.write("// Sometimes there is an extra particle at the end, too close to the start. Subtracting half the angleDelta ensures that is skipped.\n"),document.write("// Would be nice to fix this a better way.\n"),document.write("const end = start + arcLength - (angleDelta * 0.5);\n"),document.write("\n"),document.write("if (end > start) {\n"),document.write("    // Optimization: `angle=angle+angleDelta` vs. angle+=angleDelta\n"),document.write("    // V8 deoptimises with let compound assignment\n"),document.write("    for (let angle=start; angle<end; angle=angle+angleDelta) {\n"),document.write("        particleFactory(angle + Math.random() * angleDelta * randomness);\n"),document.write("    }\n"),document.write("} else {\n"),document.write("    for (let angle=start; angle>end; angle=angle+angleDelta) {\n"),document.write("        particleFactory(angle + Math.random() * angleDelta * randomness);\n"),document.write("    }\n"),document.write("}\n"),document.write("}\n"),document.write("\n"),document.write("\n"),document.write("/**\n"),document.write("* Helper used to create a spherical burst of particles.\n"),document.write("*\n"),document.write("* @param  {Number} count               The desired number of stars/particles. This value is a suggestion, and the\n"),document.write("*                                      created burst may have more particles. The current algorithm can't perfectly\n"),document.write("*                                      distribute a specific number of points evenly on a sphere's surface.\n"),document.write("* @param  {Function} particleFactory   Called once per star/particle generated. Passed two arguments:\n"),document.write("*                                        `angle`: The direction of the star/particle.\n"),document.write("*                                        `speed`: A multipler for the particle speed, from 0.0 to 1.0.\n"),document.write("* @param  {Number} startAngle=0        For segmented bursts, you can generate only a partial arc of particles. This\n"),document.write("*                                      allows setting the starting arc angle (radians).\n"),document.write("* @param  {Number} arcLength=TAU       The length of the arc (radians). Defaults to a full circle.\n"),document.write("*\n"),document.write("* @return {void}              Returns nothing; it's up to `particleFactory` to use the given data.\n"),document.write("*/\n"),document.write("function createBurst(count, particleFactory, startAngle=0, arcLength=PI_2) {\n"),document.write("// Assuming sphere with surface area of `count`, calculate various\n"),document.write("// properties of said sphere (unit is stars).\n"),document.write("// Radius\n"),document.write("const R = 0.5 * Math.sqrt(count/Math.PI);\n"),document.write("// Circumference\n"),document.write("const C = 2 * R * Math.PI;\n"),document.write("// Half Circumference\n"),document.write("const C_HALF = C / 2;\n"),document.write("\n"),document.write("// Make a series of rings, sizing them as if they were spaced evenly\n"),document.write("// along the curved surface of a sphere.\n"),document.write("for (let i=0; i<=C_HALF; i++) {\n"),document.write("    const ringAngle = i / C_HALF * PI_HALF;\n"),document.write("    const ringSize = Math.cos(ringAngle);\n"),document.write("    const partsPerFullRing = C * ringSize;\n"),document.write("    const partsPerArc = partsPerFullRing * (arcLength / PI_2);\n"),document.write("    \n"),document.write("    const angleInc = PI_2 / partsPerFullRing;\n"),document.write("    const angleOffset = Math.random() * angleInc + startAngle;\n"),document.write("    // Each particle needs a bit of randomness to improve appearance.\n"),document.write("    const maxRandomAngleOffset = angleInc * 0.33;\n"),document.write("    \n"),document.write("    for (let i=0; i<partsPerArc; i++) {\n"),document.write("        const randomAngleOffset = Math.random() * maxRandomAngleOffset;\n"),document.write("        let angle = angleInc * i + angleOffset + randomAngleOffset;\n"),document.write("        particleFactory(angle, ringSize);\n"),document.write("    }\n"),document.write("}\n"),document.write("}\n"),document.write("\n"),document.write("\n"),document.write("\n"),document.write("\n"),document.write("// Various star effects.\n"),document.write("// These are designed to be attached to a star's `onDeath` event.\n"),document.write("\n"),document.write("// Crossette breaks star into four same-color pieces which branch in a cross-like shape.\n"),document.write("function crossetteEffect(star) {\n"),document.write("const startAngle = Math.random() * PI_HALF;\n"),document.write("createParticleArc(startAngle, PI_2, 4, 0.5, (angle) => {\n"),document.write("    Star.add(\n"),document.write("        star.x,\n"),document.write("        star.y,\n"),document.write("        star.color,\n"),document.write("        angle,\n"),document.write("        Math.random() * 0.6 + 0.75,\n"),document.write("        600\n"),document.write("    );\n"),document.write("});\n"),document.write("}\n"),document.write("\n"),document.write("// Flower is like a mini shell\n"),document.write("function floralEffect(star) {\n"),document.write("const count = 12 + 6 * quality;\n"),document.write("createBurst(count, (angle, speedMult) => {\n"),document.write("    Star.add(\n"),document.write("        star.x,\n"),document.write("        star.y,\n"),document.write("        star.color,\n"),document.write("        angle,\n"),document.write("        speedMult * 2.4,\n"),document.write("        1000 + Math.random() * 300,\n"),document.write("        star.speedX,\n"),document.write("        star.speedY\n"),document.write("    );\n"),document.write("});\n"),document.write("// Queue burst flash render\n"),document.write("BurstFlash.add(star.x, star.y, 46);\n"),document.write("soundManager.playSound('burstSmall');\n"),document.write("}\n"),document.write("\n"),document.write("// Floral burst with willow stars\n"),document.write("function fallingLeavesEffect(star) {\n"),document.write("createBurst(7, (angle, speedMult) => {\n"),document.write("    const newStar = Star.add(\n"),document.write("        star.x,\n"),document.write("        star.y,\n"),document.write("        INVISIBLE,\n"),document.write("        angle,\n"),document.write("        speedMult * 2.4,\n"),document.write("        2400 + Math.random() * 600,\n"),document.write("        star.speedX,\n"),document.write("        star.speedY\n"),document.write("    );\n"),document.write("    \n"),document.write("    newStar.sparkColor = COLOR.Gold;\n"),document.write("    newStar.sparkFreq = 144 / quality;\n"),document.write("    newStar.sparkSpeed = 0.28;\n"),document.write("    newStar.sparkLife = 750;\n"),document.write("    newStar.sparkLifeVariation = 3.2;\n"),document.write("});\n"),document.write("// Queue burst flash render\n"),document.write("BurstFlash.add(star.x, star.y, 46);\n"),document.write("soundManager.playSound('burstSmall');\n"),document.write("}\n"),document.write("\n"),document.write("// Crackle pops into a small cloud of golden sparks.\n"),document.write("function crackleEffect(star) {\n"),document.write("const count = isHighQuality ? 32 : 16;\n"),document.write("createParticleArc(0, PI_2, count, 1.8, (angle) => {\n"),document.write("    Spark.add(\n"),document.write("        star.x,\n"),document.write("        star.y,\n"),document.write("        COLOR.Gold,\n"),document.write("        angle,\n"),document.write("        // apply near cubic falloff to speed (places more particles towards outside)\n"),document.write("        Math.pow(Math.random(), 0.45) * 2.4,\n"),document.write("        300 + Math.random() * 200\n"),document.write("    );\n"),document.write("});\n"),document.write("}\n"),document.write("\n"),document.write("\n"),document.write("\n"),document.write("/**\n"),document.write("* Shell can be constructed with options:\n"),document.write("*\n"),document.write("* spreadSize:      Size of the burst.\n"),document.write("* starCount: Number of stars to create. This is optional, and will be set to a reasonable quantity for size if omitted.\n"),document.write("* starLife:\n"),document.write("* starLifeVariation:\n"),document.write("* color:\n"),document.write("* glitterColor:\n"),document.write("* glitter: One of: 'light', 'medium', 'heavy', 'streamer', 'willow'\n"),document.write("* pistil:\n"),document.write("* pistilColor:\n"),document.write("* streamers:\n"),document.write("* crossette:\n"),document.write("* floral:\n"),document.write("* crackle:\n"),document.write("*/\n"),document.write("class Shell {\n"),document.write("constructor(options) {\n"),document.write("    Object.assign(this, options);\n"),document.write("    this.starLifeVariation = options.starLifeVariation || 0.125;\n"),document.write("    this.color = options.color || randomColor();\n"),document.write("    this.glitterColor = options.glitterColor || this.color;\n"),document.write("            \n"),document.write("    // Set default starCount if needed, will be based on shell size and scale exponentially, like a sphere's surface area.\n"),document.write("    if (!this.starCount) {\n"),document.write("        const density = options.starDensity || 1;\n"),document.write("        const scaledSize = this.spreadSize / 54;\n"),document.write("        this.starCount = Math.max(6, scaledSize * scaledSize * density);\n"),document.write("    }\n"),document.write("}\n"),document.write("\n"),document.write("launch(position, launchHeight) {\n"),document.write("    const width = stageW;\n"),document.write("    const height = stageH;\n"),document.write("    // Distance from sides of screen to keep shells.\n"),document.write("    const hpad = 60;\n"),document.write("    // Distance from top of screen to keep shell bursts.\n"),document.write("    const vpad = 50;\n"),document.write("    // Minimum burst height, as a percentage of stage height\n"),document.write("    const minHeightPercent = 0.45;\n"),document.write("    // Minimum burst height in px\n"),document.write("    const minHeight = height - height * minHeightPercent;\n"),document.write("    \n"),document.write("    const launchX = position * (width - hpad * 2) + hpad;\n"),document.write("    const launchY = height;\n"),document.write("    const burstY = minHeight - (launchHeight * (minHeight - vpad));\n"),document.write("    \n"),document.write("    const launchDistance = launchY - burstY;\n"),document.write("    // Using a custom power curve to approximate Vi needed to reach launchDistance under gravity and air drag.\n"),document.write("    // Magic numbers came from testing.\n"),document.write("    const launchVelocity = Math.pow(launchDistance * 0.04, 0.64);\n"),document.write("    \n"),document.write("    const comet = this.comet = Star.add(\n"),document.write("        launchX,\n"),document.write("        launchY,\n"),document.write("        typeof this.color === 'string' && this.color !== 'random' ? this.color : COLOR.White,\n"),document.write("        Math.PI,\n"),document.write("        launchVelocity * (this.horsetail ? 1.2 : 1),\n"),document.write("        // Hang time is derived linearly from Vi; exact number came from testing\n"),document.write("        launchVelocity * (this.horsetail ? 100 : 400)\n"),document.write("    );\n"),document.write("    \n"),document.write('    // making comet "heavy" limits air drag\n'),document.write("    comet.heavy = true;\n"),document.write("    // comet spark trail\n"),document.write("    //comet.spinRadius = MyMath.random(0.32, 0.85);\n"),document.write("    comet.spinRadius = RandomNumber(0.32, 0.85)\n"),document.write("    comet.sparkFreq = 32 / quality;\n"),document.write("    if (isHighQuality) comet.sparkFreq = 8;\n"),document.write("    comet.sparkLife = 320;\n"),document.write("    comet.sparkLifeVariation = 3;\n"),document.write("    if (this.glitter === 'willow' || this.fallingLeaves) {\n"),document.write("        comet.sparkFreq = 20 / quality;\n"),document.write("        comet.sparkSpeed = 0.5;\n"),document.write("        comet.sparkLife = 500;\n"),document.write("    }\n"),document.write("    if (this.color === INVISIBLE) {\n"),document.write("        comet.sparkColor = COLOR.Gold;\n"),document.write("    }\n"),document.write("    \n"),document.write('    // Randomly make comet "burn out" a bit early.\n'),document.write("    // This is disabled for horsetail shells, due to their very short airtime.\n"),document.write("    if (Math.random() > 0.4 && !this.horsetail) {\n"),document.write("        comet.secondColor = INVISIBLE;\n"),document.write("        comet.transitionTime = Math.pow(Math.random(), 1.5) * 700 + 500;\n"),document.write("    }\n"),document.write("    \n"),document.write("    comet.onDeath = comet => this.burst(comet.x, comet.y);\n"),document.write("    \n"),document.write("    soundManager.playSound('lift');\n"),document.write("}\n"),document.write("\n"),document.write("burst(x, y) {\n"),document.write("    // Set burst speed so overall burst grows to set size. This specific formula was derived from testing, and is affected by simulated air drag.\n"),document.write("    const speed = this.spreadSize / 96;\n"),document.write("\n"),document.write("    let color, onDeath, sparkFreq, sparkSpeed, sparkLife;\n"),document.write("    let sparkLifeVariation = 0.25;\n"),document.write("    // Some death effects, like crackle, play a sound, but should only be played once.\n"),document.write("    let playedDeathSound = false;\n"),document.write("    \n"),document.write("    if (this.crossette) onDeath = (star) => {\n"),document.write("        if (!playedDeathSound) {\n"),document.write("            soundManager.playSound('crackleSmall');\n"),document.write("            playedDeathSound = true;\n"),document.write("        }\n"),document.write("        crossetteEffect(star);\n"),document.write("    }\n"),document.write("    if (this.crackle) onDeath = (star) => {\n"),document.write("        if (!playedDeathSound) {\n"),document.write("            soundManager.playSound('crackle');\n"),document.write("            playedDeathSound = true;\n"),document.write("        }\n"),document.write("        crackleEffect(star);\n"),document.write("    }\n"),document.write("    if (this.floral) onDeath = floralEffect;\n"),document.write("    if (this.fallingLeaves) onDeath = fallingLeavesEffect;\n"),document.write("    \n"),document.write("    if (this.glitter === 'light') {\n"),document.write("        sparkFreq = 400;\n"),document.write("        sparkSpeed = 0.3;\n"),document.write("        sparkLife = 300;\n"),document.write("        sparkLifeVariation = 2;\n"),document.write("    }\n"),document.write("    else if (this.glitter === 'medium') {\n"),document.write("        sparkFreq = 200;\n"),document.write("        sparkSpeed = 0.44;\n"),document.write("        sparkLife = 700;\n"),document.write("        sparkLifeVariation = 2;\n"),document.write("    }\n"),document.write("    else if (this.glitter === 'heavy') {\n"),document.write("        sparkFreq = 80;\n"),document.write("        sparkSpeed = 0.8;\n"),document.write("        sparkLife = 1400;\n"),document.write("        sparkLifeVariation = 2;\n"),document.write("    }\n"),document.write("    else if (this.glitter === 'thick') {\n"),document.write("        sparkFreq = 16;\n"),document.write("        sparkSpeed = isHighQuality ? 1.65 : 1.5;\n"),document.write("        sparkLife = 1400;\n"),document.write("        sparkLifeVariation = 3;\n"),document.write("    }\n"),document.write("    else if (this.glitter === 'streamer') {\n"),document.write("        sparkFreq = 32;\n"),document.write("        sparkSpeed = 1.05;\n"),document.write("        sparkLife = 620;\n"),document.write("        sparkLifeVariation = 2;\n"),document.write("    }\n"),document.write("    else if (this.glitter === 'willow') {\n"),document.write("        sparkFreq = 120;\n"),document.write("        sparkSpeed = 0.34;\n"),document.write("        sparkLife = 1400;\n"),document.write("        sparkLifeVariation = 3.8;\n"),document.write("    }\n"),document.write("    \n"),document.write("    // Apply quality to spark count\n"),document.write("    sparkFreq = sparkFreq / quality;\n"),document.write("    \n"),document.write("    // Star factory for primary burst, pistils, and streamers.\n"),document.write("    let firstStar = true;\n"),document.write("    const starFactory = (angle, speedMult) => {\n"),document.write("        // For non-horsetail shells, compute an initial vertical speed to add to star burst.\n"),document.write("        // The magic number comes from testing what looks best. The ideal is that all shell\n"),document.write("        // bursts appear visually centered for the majority of the star life (excl. willows etc.)\n"),document.write("        const standardInitialSpeed = this.spreadSize / 1800;\n"),document.write("        \n"),document.write("        const star = Star.add(\n"),document.write("            x,\n"),document.write("            y,\n"),document.write("            color || randomColor(),\n"),document.write("            angle,\n"),document.write("            speedMult * speed,\n"),document.write("            // add minor variation to star life\n"),document.write("            this.starLife + Math.random() * this.starLife * this.starLifeVariation,\n"),document.write("            this.horsetail ? this.comet && this.comet.speedX : 0,\n"),document.write("            this.horsetail ? this.comet && this.comet.speedY : -standardInitialSpeed\n"),document.write("        );\n"),document.write("\n"),document.write("        if (this.secondColor) {\n"),document.write("            star.transitionTime = this.starLife * (Math.random() * 0.05 + 0.32);\n"),document.write("            star.secondColor = this.secondColor;\n"),document.write("        }\n"),document.write("\n"),document.write("        if (this.strobe) {\n"),document.write("            star.transitionTime = this.starLife * (Math.random() * 0.08 + 0.46);\n"),document.write("            star.strobe = true;\n"),document.write('            // How many milliseconds between switch of strobe state "tick". Note that the strobe pattern\n'),document.write('            // is on:off:off, so this is the "on" duration, while the "off" duration is twice as long.\n'),document.write("            star.strobeFreq = Math.random() * 20 + 40;\n"),document.write("            if (this.strobeColor) {\n"),document.write("                star.secondColor = this.strobeColor;\n"),document.write("            }\n"),document.write("        }\n"),document.write("        \n"),document.write("        star.onDeath = onDeath;\n"),document.write("\n"),document.write("        if (this.glitter) {\n"),document.write("            star.sparkFreq = sparkFreq;\n"),document.write("            star.sparkSpeed = sparkSpeed;\n"),document.write("            star.sparkLife = sparkLife;\n"),document.write("            star.sparkLifeVariation = sparkLifeVariation;\n"),document.write("            star.sparkColor = this.glitterColor;\n"),document.write("            star.sparkTimer = Math.random() * star.sparkFreq;\n"),document.write("        }\n"),document.write("    };\n"),document.write("    \n"),document.write("    \n"),document.write("    if (typeof this.color === 'string') {\n"),document.write("        if (this.color === 'random') {\n"),document.write("            color = null; // falsey value creates random color in starFactory\n"),document.write("        } else {\n"),document.write("            color = this.color;\n"),document.write("        }\n"),document.write("        \n"),document.write("        // Rings have positional randomness, but are rotated randomly\n"),document.write("        if (this.ring) {\n"),document.write("            const ringStartAngle = Math.random() * Math.PI;\n"),document.write("            const ringSquash = Math.pow(Math.random(), 2) * 0.85 + 0.15;;\n"),document.write("            \n"),document.write("            createParticleArc(0, PI_2, this.starCount, 0, angle => {\n"),document.write("                // Create a ring, squashed horizontally\n"),document.write("                const initSpeedX = Math.sin(angle) * speed * ringSquash;\n"),document.write("                const initSpeedY = Math.cos(angle) * speed;\n"),document.write("                // Rotate ring\n"),document.write("                const newSpeed = MyMath.pointDist(0, 0, initSpeedX, initSpeedY);\n"),document.write("                const newAngle = MyMath.pointAngle(0, 0, initSpeedX, initSpeedY) + ringStartAngle;\n"),document.write("                const star = Star.add(\n"),document.write("                    x,\n"),document.write("                    y,\n"),document.write("                    color,\n"),document.write("                    newAngle,\n"),document.write("                    // apply near cubic falloff to speed (places more particles towards outside)\n"),document.write("                    newSpeed,//speed,\n"),document.write("                    // add minor variation to star life\n"),document.write("                    this.starLife + Math.random() * this.starLife * this.starLifeVariation\n"),document.write("                );\n"),document.write("                \n"),document.write("                if (this.glitter) {\n"),document.write("                    star.sparkFreq = sparkFreq;\n"),document.write("                    star.sparkSpeed = sparkSpeed;\n"),document.write("                    star.sparkLife = sparkLife;\n"),document.write("                    star.sparkLifeVariation = sparkLifeVariation;\n"),document.write("                    star.sparkColor = this.glitterColor;\n"),document.write("                    star.sparkTimer = Math.random() * star.sparkFreq;\n"),document.write("                }\n"),document.write("            });\n"),document.write("        }\n"),document.write("        // Normal burst\n"),document.write("        else {\n"),document.write("            createBurst(this.starCount, starFactory);\n"),document.write("        }\n"),document.write("    }\n"),document.write("    else if (Array.isArray(this.color)) {\n"),document.write("        if (Math.random() < 0.5) {\n"),document.write("            const start = Math.random() * Math.PI;\n"),document.write("            const start2 = start + Math.PI;\n"),document.write("            const arc = Math.PI;\n"),document.write("            color = this.color[0];\n"),document.write("            // Not creating a full arc automatically reduces star count.\n"),document.write("            createBurst(this.starCount, starFactory, start, arc);\n"),document.write("            color = this.color[1];\n"),document.write("            createBurst(this.starCount, starFactory, start2, arc);\n"),document.write("        } else {\n"),document.write("            color = this.color[0];\n"),document.write("            createBurst(this.starCount / 2, starFactory);\n"),document.write("            color = this.color[1];\n"),document.write("            createBurst(this.starCount / 2, starFactory);\n"),document.write("        }\n"),document.write("    }\n"),document.write("    else {\n"),document.write("        throw new Error('Invalid shell color. Expected string or array of strings, but got: ' + this.color);\n"),document.write("    }\n"),document.write("    \n"),document.write("    if (this.pistil) {\n"),document.write("        const innerShell = new Shell({\n"),document.write("            spreadSize: this.spreadSize * 0.5,\n"),document.write("            starLife: this.starLife * 0.6,\n"),document.write("            starLifeVariation: this.starLifeVariation,\n"),document.write("            starDensity: 1.4,\n"),document.write("            color: this.pistilColor,\n"),document.write("            glitter: 'light',\n"),document.write("            glitterColor: this.pistilColor === COLOR.Gold ? COLOR.Gold : COLOR.White\n"),document.write("        });\n"),document.write("        innerShell.burst(x, y);\n"),document.write("    }\n"),document.write("    \n"),document.write("    if (this.streamers) {\n"),document.write("        const innerShell = new Shell({\n"),document.write("            spreadSize: this.spreadSize * 0.9,\n"),document.write("            starLife: this.starLife * 0.8,\n"),document.write("            starLifeVariation: this.starLifeVariation,\n"),document.write("            starCount: Math.floor(Math.max(6, this.spreadSize / 45)),\n"),document.write("            color: COLOR.White,\n"),document.write("            glitter: 'streamer'\n"),document.write("        });\n"),document.write("        innerShell.burst(x, y);\n"),document.write("    }\n"),document.write("    \n"),document.write("    // Queue burst flash render\n"),document.write("    BurstFlash.add(x, y, this.spreadSize / 4);\n"),document.write("\n"),document.write('    // Play sound, but only for "original" shell, the one that was launched.\n'),document.write('    // We don\'t want multiple sounds from pistil or streamer "sub-shells".\n'),document.write("    // This can be detected by the presence of a comet.\n"),document.write("    if (this.comet) {\n"),document.write("        // Scale explosion sound based on current shell size and selected (max) shell size.\n"),document.write("        // Shooting selected shell size will always sound the same no matter the selected size,\n"),document.write("        // but when smaller shells are auto-fired, they will sound smaller. It doesn't sound great\n"),document.write("        // when a value too small is given though, so instead of basing it on proportions, we just\n"),document.write("        // look at the difference in size and map it to a range known to sound good.\n"),document.write("        const maxDiff = 2;\n"),document.write("        const sizeDifferenceFromMaxSize = Math.min(maxDiff, shellSizeSelector() - this.shellSize);\n"),document.write("        const soundScale = (1 - sizeDifferenceFromMaxSize / maxDiff) * 0.3 + 0.7;\n"),document.write("        soundManager.playSound('burst', soundScale);\n"),document.write("    }\n"),document.write("}\n"),document.write("}\n"),docum